import React, { useState, useEffect } from 'react';
import api, { deleteData, postData } from '../../api/endpoint'; // ✅ CORRIGÉ
import { FiFileText, FiSearch, FiPlus, FiEdit, FiTrash2, FiEye } from 'react-icons/fi';

const Patients = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [patients, setPatients] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [showModal, setShowModal] = useState(false);
  const [selectedPatient, setSelectedPatient] = useState(null);
  const [showForm, setShowForm] = useState(false);
  const [formData, setFormData] = useState({
    fullName: '',
    email: '',
    password: '',
    date_of_birth: '',
    sexe: '',
    statut: 'ACTIF'
  });
  const [formError, setFormError] = useState('');
  const [submitting, setSubmitting] = useState(false);

  useEffect(() => {
    loadPatients();
  }, []);

  const loadPatients = async () => {
    try {
      setLoading(true);
      setError(null);
      const users = await api.getData('/users'); // ✅ CORRIGÉ
      const patientsList = users.filter(user => user.role === 'Patient');
      setPatients(patientsList);
    } catch (err) {
      console.error('Erreur chargement patients:', err);
      setError(err.message || 'Impossible de charger les patients.');
      setPatients([]);
    } finally {
      setLoading(false);
    }
  };

  const handleDelete = async (patientId) => {
    if (!window.confirm('Êtes-vous sûr de vouloir supprimer ce patient ?')) return;
    try {
      await deleteData(`/users/${patientId}`); // ✅ ENDPOINT STANDARD
      loadPatients();
    } catch (err) {
      alert(err.message || 'Erreur suppression');
    }
  };

  const handleView = (patient) => {
    setSelectedPatient(patient);
    setShowModal(true);
  };

  const handleOpenForm = () => {
    setFormData({
      fullName: '',
      email: '',
      password: '',
      date_of_birth: '',
      sexe: '',
      statut: 'ACTIF'
    });
    setFormError('');
    setShowForm(true);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setFormError('');
    setSubmitting(true);

    if (!formData.fullName || !formData.email || !formData.password) {
      setFormError('Veuillez remplir tous les champs obligatoires');
      setSubmitting(false);
      return;
    }

    if (formData.password.length < 6) {
      setFormError('Le mot de passe doit contenir au moins 6 caractères');
      setSubmitting(false);
      return;
    }

    try {
      const patientData = {
        fullName: formData.fullName,
        email: formData.email,
        motDePasse: formData.password,
        role: 'Patient',
        dateNaissance: formData.date_of_birth || undefined,
        sexe: formData.sexe || undefined,
        statut: formData.statut
      };

      await postData('/auth/register', patientData); // ✅ ENDPOINT STANDARD
      handleCloseForm();
      loadPatients();
    } catch (err) {
      setFormError(err.message || 'Erreur création patient');
    } finally {
      setSubmitting(false);
    }
  };

  const calculateAge = (dateOfBirth) => {
    if (!dateOfBirth) return 'N/A';
    const birthDate = new Date(dateOfBirth);
    const today = new Date();
    let age = today.getFullYear() - birthDate.getFullYear();
    const monthDiff = today.getMonth() - birthDate.getMonth();
    if (monthDiff < 0 || (monthDiff === 0 && today.getDate() < birthDate.getDate())) {
      age--;
    }
    return age;
  };

  // ✅ TOUT LE JSX RESTE IDENTIQUE (EXCELLENT)
  const filteredPatients = patients.filter(patient =>
    patient.fullName?.toLowerCase().includes(searchTerm.toLowerCase()) ||
    patient.email?.toLowerCase().includes(searchTerm.toLowerCase())
  );

  // ... VOTRE JSX COMPLET IDENTIQUE ✅
// ✅ TEMPLATE CORRIGÉ POUR CHAQUE PAGE
const NomPage = () => {
  // ... VOS useState() + useEffect() ✅

  if (loading) return <div className="flex items-center justify-center h-64 p-6"><div className="text-lg">Chargement...</div></div>;

  return (
    <div className="p-6 max-w-7xl mx-auto">
      {/* VOTRE TITRE */}
      <div className="mb-8">
        <h1 className="text-3xl font-bold text-gray-900">Votre Titre</h1>
        <p className="text-gray-600 mt-2">Description</p>
      </div>

      {/* VOTRE TABLEAU / FORMULAIRE */}
      <div className="bg-white rounded-2xl shadow-lg border border-gray-100 overflow-hidden">
        {/* CONTENU */}
      </div>
    </div>
  );
};


};

export default Patients;
